import React from 'react';
import styled from 'styled-components';
import PropTypes from 'prop-types';
import Link from 'next/link';

const LikedList = styled.li`
  width: 100%;
  height: 30px;
  text-align: left;
  border-bottom: solid 2px #495057;
  &:nth-child(2n) {
    background: #495057;
  }

  & + & {
    margin-top: 10px;
  }
`;

const Writer = styled.label`
  display: block;
  width: 35%;
  height: 1rem;
  float: left;
  cursor: pointer;
  margin-top: auto;
  margin-bottom: auto;
`;

const Bookname = styled.label`
  display: block;
  width: 65%;
  height: 1rem;
  white-space: nowrap;
  overflow: hidden;
  text-overflow: ellipsis;
  cursor: pointer;
`;

const LikedBook = ({ likedBook }) => {
  return (
    <LikedList>
      <Link href={`/writer`}>
        <a>
          <Writer>{likedBook.writer}</Writer>
        </a>
      </Link>
      <Link href={`/book`}>
        <a>
          <Bookname>{likedBook.bookname}</Bookname>
        </a>
      </Link>
    </LikedList>
  );
};

LikedBook.propTypes = {
  likedBook: PropTypes.shape({
    writer: PropTypes.string,
    bookname: PropTypes.string,
  }),
};

export default LikedBook;
